import React, { useState } from "react";
import {  useSelector } from "react-redux";
import {ApplicationState} from '../types'
import ProductSummary from '../components/ProductSummary'

const ProductSummaryContainer: React.FC = () => {
    const data = useSelector((state: ApplicationState) => state.data);


    return (
        <div className="ProductSummaryContainer">
        {data && data.length !== 0 && (
          <ProductSummary productdata={data} />
        )}
      </div>

    );
  };

  export default ProductSummaryContainer;
